INSERT INTO `pages` (`id`, `type`, `title`, `slug`, `content`, `meta_title`, `meta_description`, `keywords`, `meta_image`, `created_at`, `updated_at`) VALUES
(1, 'home_page', 'Home Page', 'home', NULL, NULL, NULL, NULL, NULL, '2020-11-04 10:13:20', '2020-11-04 10:13:20'),
(2, 'seller_policy_page', 'سياسة البائع', 'sellerpolicy', '<p style=\"padding: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px; line-height: 1.5em; color: rgb(17, 17, 17);\">تتطلب هذه السياسة أن يتصرف البائعون بشكل عادل وبأمانة في أمازون لضمان تجربة شراء وبيع آمنة. يجب على جميع البائعين:</p><ul class=\"a-vertical\" style=\"margin-right: 18px; margin-bottom: 0px; margin-left: 0px; color: rgb(17, 17, 17); padding: 0px; font-family: Arial, sans-serif; font-size: 15px;\"><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">تقديم معلومات دقيقة إلى أمازون وعملائنا في جميع الأوقات</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">التصرف بشكل عادل وعدم إساءة استخدام الخاصيات أو خدمات أمازون</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم محاولة إساءة الاستخدام أو إلحاق الضرر ببائع آخر أو بعروضه أو تقييماته</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم محاولة التأثير على تقييمات العملاء والتقييمات والآراء</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم إرسال عمليات تواصل غير مرغوب فيها أو غير مناسبة</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم الاتصال بالعملاء إلا من خلال خدمة الرسائل بين المشتري والبائع</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم محاولة التحايل على عملية مبيعات أمازون</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم تشغيل أكثر من حساب بيع على أمازون دون الحاجة إلى نشاط تجاري قانوني</span></li></ul><p style=\"padding: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px; line-height: 1.5em; color: rgb(17, 17, 17);\"></p><p style=\"padding: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px; line-height: 1.5em; color: rgb(17, 17, 17);\">قد يؤدي انتهاك مدونة قواعد السلوك أو أي سياسات أخرى في أمازون إلى اتخاذ إجراءات ضد حسابك، مثل إلغاء العروض، وتعليق أو مصادرة المدفوعات، وإزالة امتيازات البيع. وفيما يلي مزيد من التفاصيل حول هذه السياسات.</p>', NULL, NULL, NULL, NULL, '2020-11-04 10:14:41', '2021-02-26 20:09:57'),
(3, 'return_policy_page', 'Return Policy Page', 'returnpolicy', '<p style=\"text-align: center; \"><b>سياسة الإستبدال والإسترجاع</b></p><ol><li style=\"text-align: right;\"><b>تقديم أصل فاتورة البيع.</b></li><li style=\"text-align: right;\"><b>يمكن الإرتجاع خلال 14 يوم من تاريخ الشراء.</b></li><li style=\"text-align: right;\"><b>أن تكون البضاعة في حالتها الأصلية.</b></li><li style=\"text-align: right;\"><b>تكون طريقة إسترداد القيمة بنفس طريقة الدفع.</b></li><li style=\"text-align: right;\"><b>يمكن للعميل إسترداد القيمة التيقام فعلاً بدفعها كما هو مسجل ومحدد في فاتورة البيع.</b></li><li style=\"text-align: right;\"><b>من حق العميل إستبدال السلعة بإخري بذات القيمة المدونة علي الفاتورة.</b></li></ol><p style=\"text-align: center;\"><b>جهاز حماية المستهلك</b></p>', NULL, NULL, NULL, NULL, '2020-11-04 10:14:41', '2021-03-07 14:58:59'),
(4, 'support_policy_page', 'Support Policy Page', 'supportpolicy', NULL, NULL, NULL, NULL, NULL, '2020-11-04 10:14:59', '2020-11-04 10:14:59'),
(5, 'terms_conditions_page', 'Term Conditions Page', 'terms', '<p class=\"MsoNormal\" dir=\"RTL\" style=\"text-align: center; margin-bottom: 18.75pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">عالم العدد</span></b></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"text-align: center; margin-bottom: 18.75pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">شروط\r\nالموقع</span></b><span dir=\"LTR\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"margin-bottom: 18.75pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">مرحباً بكم في عالم\r\nالعدد</span></b></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"margin-right: 18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">&nbsp;كيفية استخدامكم\r\nلخدماتنا من أجل شراء</span></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"margin-right: 18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">المنتجات</span></b><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\" style=\"font-size:11.5pt;\r\nfont-family:\" helvetica\",sans-serif;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";=\"\" color:#4b4d4d\"=\"\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>) </span><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">عبر موقع عالم العدد.\r\nالتجاري)</span></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"margin-right: 18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">خدماتنا</span></b><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\"> يمكنك إنشاء حساب مشتري\r\nصحيح ويجوز لنا تعديل خدماتنا من حين لآخر</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"margin-right: 18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">كلمات السر</span></b><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\" style=\"font-size:11.5pt;\r\nfont-family:\" helvetica\",sans-serif;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";=\"\" color:#4b4d4d\"=\"\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>: </span><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">في حالة اختياركم أو تم\r\nتزويدكم باسم مستخدم أو كلمة سر أو أية معلومة أخرى كجزء من إجراءاتنا الأمنية،\r\nيجب عليكم التعامل مع هذه المعلومات بسرية تامة، حيث تتحملون المسؤولية وحدكم عن\r\nالحفاظ على سلامة كلمة السر الخاصة بكم. ولا يجوز لكم الإفصاح عن كلمة السر للغير </span><span dir=\"LTR\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:\r\n11.5pt;font-family:\" helvetica\",sans-serif;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";=\"\" color:#4b4d4d\"=\"\">السياسات المحددة</span></b><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>: </span><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">بإنشاء حساب مشتري صحيح\r\nلكل شخص او شركة، فإنكم توافقون في وقت إنشاء الحساب أو التسجيل على الالتزام\r\nوالتقيد بشروط الموقع هذه وكذلك جميع السياسات والبروتوكولات والإرشادات وغير ذلك\r\nمن <b>طرف عالم العدد&nbsp;</b></span></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:\r\n11.5pt;font-family:\" helvetica\",sans-serif;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";=\"\" color:#4b4d4d\"=\"\">خدمات عالم العدد التجاريه الخاصة بنا</span></b><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>: </span><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\r\n\" helvetica\",sans-serif;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">وفقاً\r\nلشروط الموقع هذه، نوفر لكم الموقع على شبكة الانترنت وأجهزة الهاتف المحمول\r\nلتمكينكم من شراء البضائع (التي تختارونها ونوافق عليها)&nbsp; وإتمام\r\nالمعاملات &nbsp;<b><o:p></o:p></b></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" dir=\"RTL\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"AR-SA\" style=\"font-size:\r\n11.5pt;font-family:\" helvetica\",sans-serif;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";=\"\" color:#4b4d4d\"=\"\">واجبات المشتري</span></b><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>: </span><span lang=\"AR-SA\" style=\"font-size:11.5pt;font-family:\" helvetica\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\">يجوز لكم فقط الاستفادة\r\nمن الموقع لأغراض مشروعة وبصورة قانونية. ويجب عليكم الالتزام بجميع القوانين\r\nالمعمول بها في الدولة&nbsp;</span><span dir=\"LTR\" style=\"font-size:11.5pt;font-family:\r\n\" helvetica\",sans-serif;mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#4b4d4d\"=\"\"><o:p></o:p></span></p>', NULL, NULL, NULL, NULL, '2020-11-04 10:15:29', '2021-03-07 16:07:32'),
(6, 'privacy_policy_page', 'Privacy Policy Page', 'privacypolicy', NULL, NULL, NULL, NULL, NULL, '2020-11-04 10:15:55', '2020-11-04 10:15:55');
