(1, 2, 'سياسة البائع', '<p style=\"padding: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px; line-height: 1.5em; color: rgb(17, 17, 17);\">تتطلب هذه السياسة أن يتصرف البائعون بشكل عادل وبأمانة في أمازون لضمان تجربة شراء وبيع آمنة. يجب على جميع البائعين:</p><ul class=\"a-vertical\" style=\"margin-right: 18px; margin-bottom: 0px; margin-left: 0px; color: rgb(17, 17, 17); padding: 0px; font-family: Arial, sans-serif; font-size: 15px;\"><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">تقديم معلومات دقيقة إلى أمازون وعملائنا في جميع الأوقات</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">التصرف بشكل عادل وعدم إساءة استخدام الخاصيات أو خدمات أمازون</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم محاولة إساءة الاستخدام أو إلحاق الضرر ببائع آخر أو بعروضه أو تقييماته</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم محاولة التأثير على تقييمات العملاء والتقييمات والآراء</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم إرسال عمليات تواصل غير مرغوب فيها أو غير مناسبة</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم الاتصال بالعملاء إلا من خلال خدمة الرسائل بين المشتري والبائع</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم محاولة التحايل على عملية مبيعات أمازون</span></li><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px 0px 4px;\"><span class=\"a-list-item\" style=\"margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">عدم تشغيل أكثر من حساب بيع على أمازون دون الحاجة إلى نشاط تجاري قانوني</span></li></ul><p style=\"padding: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px; line-height: 1.5em; color: rgb(17, 17, 17);\"></p><p style=\"padding: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px; line-height: 1.5em; color: rgb(17, 17, 17);\">قد يؤدي انتهاك مدونة قواعد السلوك أو أي سياسات أخرى في أمازون إلى اتخاذ إجراءات ضد حسابك، مثل إلغاء العروض، وتعليق أو مصادرة المدفوعات، وإزالة امتيازات البيع. وفيما يلي مزيد من التفاصيل حول هذه السياسات.</p>', 'eg', '2021-02-26 20:09:57', '2021-02-26 20:09:57'),
(2, 3, 'Return Policy Page', '<p style=\"text-align: center; \"><b>سياسة الإستبدال والإسترجاع</b></p><ol><li style=\"text-align: right;\"><b>تقديم أصل فاتورة البيع.</b></li><li style=\"text-align: right;\"><b>يمكن الإرتجاع خلال 14 يوم من تاريخ الشراء.</b></li><li style=\"text-align: right;\"><b>أن تكون البضاعة في حالتها الأصلية.</b></li><li style=\"text-align: right;\"><b>تكون طريقة إسترداد القيمة بنفس طريقة الدفع.</b></li><li style=\"text-align: right;\"><b>يمكن للعميل إسترداد القيمة التيقام فعلاً بدفعها كما هو مسجل ومحدد في فاتورة البيع.</b></li><li style=\"text-align: right;\"><b>من حق العميل إستبدال السلعة بإخري بذات القيمة المدونة علي الفاتورة.</b></li></ol><p style=\"text-align: center;\"><b>جهاز حماية المستهلك</b></p>', 'eg', '2021-03-07 14:58:59', '2021-03-07 14:58:59'),
